#include<iostream>
using namespace std;
    int minimumLength(string s) {
        string result="";
        int i=0,j=s.size()-1;
        while(i<j){
            if(s[i]==s[j]){
                while((s[i]==s[i+1] or s[j]==s[j-1]) and i+1!=j){
                    if(s[i]==s[i+1]) i++;
                    else if(s[j]==s[j-1]) j--;
                    else break;
                }
                result=s.substr(i+1,j-i-1);
                i++;j--;
            }
            else {
                result=s.substr(i+1,j-i-1);break;
            }    
        }
        return result.size();
    }
    int main(){
        string s="";
        cout<<minimumLength(s);
        return 0;
    }
